import React from 'react'
import {Link} from 'react-router-dom'

export default function Contact() {
  return (
    <div>
      <div style={{fontFamily: 'Josefin Sans'}} className="mt-5 bg-white">
      <h1>Contact us!</h1>
      <h4 as={{Link}} style={{color: 'black'}} className='fa-solid fa-envelope mb-5' onClick={() => window.location = 'mailto:diamonddoesmusic@gmail.com'}>{""} diamonddoesmusic@gmail.com</h4>
    </div>
    </div>
  )
}
